import React from 'react';
import { BrowserRouter as Router, Route, Routes, Link, Navigate } from 'react-router-dom';
import Home from './components/Home.jsx';
import Order from './components/Order.js';
import Register from './components/Register.js';
import Log from './components/Login.js';
import Signup from './components/Signup.js';
import Products from './components/products.js';
import logo from './components/logo6.png';

import './App.css';
const isAdmin = true; 
function App() {
  return (
    <Router>
      <div>
       <div className="navibar">
       <img className="logo" src={logo} alt="logo" />
          <Link className="home" to="/">HOME</Link>
          <Link className="Products" to="/Products">PRODUCTS</Link>
         <Link className="Order" to="/Order">ORDER</Link>


          {isAdmin && <Link className="admin" to="/admin">LOGIN / SIGNUP</Link>}
        </div>
        <div className="content">
          <Routes>
            <Route path="/" element={<Home />} />
            <Route path="/products" element={<Products />} />
            <Route path='/signup' element={<Register/>}/>
            <Route path="/Order" element={<Order/>} />
            <Route path="/login" element={<Log />} />



            {isAdmin ? (
              <Route path="/admin" element={<Signup />} />
            ) : (
              <Route path="*" element={<Navigate to="/events" />} />
            )}

          </Routes>

        </div>
        <div  className='homepage-content'>
        </div>
      </div>
    </Router>
  );
}

export default App;
